import { deepCopy } from 'deep-copy-ts';
import {generateData} from "./dataset";
import  {inference_gpu_execution_data} from "./dataset";
import  {inference_gpu_accuracy_data} from "./dataset";
import  {inference_cpu_execution_data} from "./dataset";
import  {inference_cpu_accuracy_data} from "./dataset";
import  {training_execution_data} from "./dataset";
import  {training_accuracy_data} from "./dataset";

generateData();

export const data = [deepCopy(inference_gpu_execution_data), 
  deepCopy(inference_cpu_execution_data),
  deepCopy(inference_gpu_accuracy_data),
  deepCopy(inference_cpu_accuracy_data),
  deepCopy(training_execution_data),
  deepCopy(training_accuracy_data) ] ;

  generateData();

export const data2 = [deepCopy(inference_gpu_execution_data), 
  deepCopy(inference_cpu_execution_data),
  deepCopy(inference_gpu_accuracy_data),
  deepCopy(inference_cpu_accuracy_data),
  deepCopy(training_execution_data),
  deepCopy(training_accuracy_data) ] ;

  generateData();

export const data3 = [deepCopy(inference_gpu_execution_data), 
  deepCopy(inference_cpu_execution_data),
  deepCopy(inference_gpu_accuracy_data),
  deepCopy(inference_cpu_accuracy_data),
  deepCopy(training_execution_data),
  deepCopy(training_accuracy_data) ] ;






